  // category spending
 // ------------------------------------------------------------------------------------------------------------- 

 const ArrayOfBills = AllTransactions.filter( t => t.spendingSection === "bills" )
 const ArrayOfSubscriptions = AllTransactions.filter( t => t.spendingSection === "subscriptions" )
